def maxVowels(s: str, k: int):
    max_arr = []
    vo = ['a','e','i','o','u']
    i = 0
    j = k
    
    while j<len(s)+1:
        counter = 0
        t = s[i:j]
        # print(t)
        for l in t:
            if l in vo:
                counter+= 1
        max_arr.append(counter)
        i+= 1
        j+= 1
    return max(max_arr)
print(maxVowels("",3945))


